import React, { useState } from "react";
import gsap from "gsap";
import Card from "react-bootstrap/Card";

const Yess = (props) => {
  gsap.to(".latestM", 1, { display: "none" });
  return (
    <div>
      <Card className="movie" style={{ width: "15rem" }}>
        <button>
          <Card.Img
            variant="top"
            src={`https://image.tmdb.org/t/p/w185/` + props.img}
          />
        </button>
      </Card>
    </div>
  );
};

export default Yess;
